import React from "react";
import styled from "styled-components";

const Global = createGlobalStyle`
    *,
    *::after,
    *::before {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
    }
`;

const Header = styled.header`
	position: fixed;
	top: 0;
	width: 100%;
	background-color: pink;
`;

const App = () => {
	return (
		<div className="App">
			<Header>Bienys</Header>
		</div>
	);
};

export default App;
